import React, { useRef, useEffect } from 'react'
import { useGLTF, useAnimations } from '@react-three/drei'

export default function Model(props) {
  const group = useRef()
  const { nodes, materials, animations } = useGLTF('/Pod.glb')
  const { actions } = useAnimations(animations, group)
  useEffect(() => {
    actions.Sit.play();
  })
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene" position={[3, -1, -1.5]} rotation={[0.3, -1.3, -0.1]} scale={1.5} >
        <group name="Armature" position={[-0.11, 1.47, 1.04]} rotation={[1.66, 0, 0]} scale={0.01}>
          <primitive object={nodes.mixamorig1Hips} />
          <group name="Ch50">
            <skinnedMesh name="Mesh" geometry={nodes.Mesh.geometry} material={materials.Ch50_body1} skeleton={nodes.Mesh.skeleton} />
            <skinnedMesh name="Mesh_1" geometry={nodes.Mesh_1.geometry} material={materials.Ch50_body} skeleton={nodes.Mesh_1.skeleton} />
          </group>
        </group>
        <mesh name="crystal_3_low" geometry={nodes.crystal_3_low.geometry} material={materials.TD_Checker} position={[-0.05, 0.85, -0.49]} rotation={[-1.64, 0.06, -3.14]} scale={0.28} />
      </group>
    </group>
  )
}

useGLTF.preload('/Pod.glb')
